text:
#Ukraine 🇺🇦 | La solidarité de la France se poursuit. 

Grâce à la mobilisation de plus de 1000 collectivités locales et de plus de 50 entreprises, un 3e convoi est parti vers l'Ukraine en présence de @JeanCastex et de @JY_LeDrian.

@francediplo https://t.co/IdE6ahH6tF

